import React from "react";

export const FriendsButton = () => {
  return <button id="friends">친구</button>;
};

export const FriendsPopup = () => {
  return (
    <>
      <div className="popup friends_popup">
        <button className="exit"></button>
        <div className="friends">
          <ul>
            <li id="me">
              <div className="inforow">
                <div className="profileimg"></div>
                <div className="profileinfo">
                  <span className="name">이름</span>
                  <span className="info">공부하는 중...</span>
                </div>
              </div>
            </li>
            {["you1", "you2", "you3"].map((friend, index) => (
              <li className="you" key={index}>
                <div className="inforow">
                  <div className="profileimg"></div>
                  <div className="profileinfo">
                    <span className="name">친구 이름 {index + 1}</span>
                    <span className="info">친구 정보 {index + 1}</span>
                  </div>
                </div>
                <div className="friendsinfo">
                  <span className="name">친구 상세 이름 {index + 1}</span>
                  <span className="info">친구 상세 정보 {index + 1}</span>
                </div>
              </li>
            ))}
          </ul>
        </div>
      </div>
    </>
  );
};

export const FriendsBox = () => {
  return <div className="friendsBox"></div>;
};

const Friends = {
  FriendsButton,
  FriendsBox,
  FriendsPopup,
};

export default Friends;
